function addSectionExpanders(){const e=document.querySelectorAll("tr.section-expander");for(const n of Array.from(e))n.onclick=()=>{const e=n.parentElement.nextElementSibling,t=n.querySelector("i");e.classList.contains("hidden-tests")?(e.classList.remove("hidden-tests"),t.innerText="expand_less"):(e.classList.add("hidden-tests"),t.innerText="expand_more"),spyglass.contentUpdated()}}function addTestExpanders(){const e=document.querySelectorAll(".failure-name,.flaky-name");for(const n of Array.from(e))n.onclick=()=>{const e=n.nextElementSibling,t=n.querySelector("i");e.classList.contains("hidden")?(e.classList.remove("hidden"),t.innerText="expand_less"):(e.classList.add("hidden"),t.innerText="expand_more"),spyglass.contentUpdated()}}function addStdoutOpeners(){const e=document.querySelectorAll("a.open-stdout");for(const n of Array.from(e))n.onclick=e=>{e.preventDefault();const t=new Blob([`\n      <head>\n        <title>Logs</title>\n      </head>\n      <body style="background-color: #303030; color: white; font-family: monospace; white-space: pre-wrap;">${n.nextElementSibling.innerHTML}</body>`],{type:"text/html"});window.open(URL.createObjectURL(t))}}function loaded(){addTestExpanders(),addStdoutOpeners(),addSectionExpanders()}window.addEventListener("DOMContentLoaded",loaded);